const gameBoard = document.getElementById('game-board');
const resetBtn = document.getElementById('reset-btn');
const timerDisplay = document.getElementById('timer');
const movesDisplay = document.getElementById('moves');
const winMessage = document.getElementById('win-message');

let cards = [];
let flippedCards = [];
let lockBoard = false;
let moves = 0;
let timer = 0;
let timerInterval;


const flipSound = new Audio("https://cdn.pixabay.com/download/audio/2022/03/15/audio_7f5d55d4b0.mp3?filename=card-flip-90744.mp3");
const matchSound = new Audio("https://cdn.pixabay.com/download/audio/2022/03/15/audio_7a845d545b.mp3?filename=success-1-6297.mp3");
const winSound = new Audio("https://cdn.pixabay.com/download/audio/2022/03/15/audio_9db11a087c.mp3?filename=success-fanfare-trumpets-6185.mp3");

const images = [
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR4RcCMLeRMOtqUXQppIxO8SE3IQxh6rbdYNA&s",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQd2acjsrTIunE-S7WtzySqXOm1dfWu8rtg5w&s",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSU-CupUOca0d6ys08zQNdo53A4l11U2M8l2w&s",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSpG6CPNNVirU2bj-fHanbha8dmRQryT19NKQ&s",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTfm2_i6EThEL7brLf2bMWVUARojE-9YZqeDQ&s"
];

function startTimer() {
  clearInterval(timerInterval);
  timer = 0;
  timerDisplay.textContent = 0;
  timerInterval = setInterval(() => {
    timer++;
    timerDisplay.textContent = timer;
  }, 1000);
}


function generateCards() {
  const pairs = [];
  for (let i = 0; i < images.length; i++) {
    pairs.push(images[i]);
    pairs.push(images[i]);
  }

  pairs.sort(() => 0.5 - Math.random());
  gameBoard.innerHTML = '';
  cards = [];
  flippedCards = [];
  lockBoard = false;
  moves = 0;
  movesDisplay.textContent = 0;
  winMessage.classList.add('hidden');
  startTimer();

  pairs.forEach(imgSrc => {
    const card = document.createElement('div');
    card.classList.add('card');
    card.dataset.image = imgSrc;

    const cardInner = document.createElement('div');
    cardInner.classList.add('card-inner');

    const cardFront = document.createElement('div');
    cardFront.classList.add('card-front');

    const cardBack = document.createElement('div');
    cardBack.classList.add('card-back');


    const img = document.createElement('img');
    img.src = imgSrc;
    img.alt = 'card';
    cardBack.appendChild(img);

    cardInner.appendChild(cardFront);
    cardInner.appendChild(cardBack);
    card.appendChild(cardInner);

    card.addEventListener('click', () => flipCard(card));
    gameBoard.appendChild(card);
    cards.push(card);
  });
}

function flipCard(card) {
  if (lockBoard || card.classList.contains('flipped') || card.classList.contains('matched')) return;
  flipSound.play();
  card.classList.add('flipped');
  flippedCards.push(card);

  if (flippedCards.length === 2) {
    moves++;
    movesDisplay.textContent = moves;
    checkMatch();
  }
}


function checkMatch() {
  const [card1, card2] = flippedCards;

  if (card1.dataset.image === card2.dataset.image) {
    card1.classList.add('matched');
    card2.classList.add('matched');
    flippedCards = [];
    matchSound.play();
    checkWin();
  } else {
    lockBoard = true;
    setTimeout(() => {
      card1.classList.remove('flipped');
      card2.classList.remove('flipped');
      flippedCards = [];
      lockBoard = false;
    }, 1000);
  }
}

function checkWin() {
  const allMatched = cards.every(card => card.classList.contains('matched'));
  if (allMatched) {
    clearInterval(timerInterval);
    setTimeout(() => {
      winMessage.classList.remove('hidden');
      winSound.play();
      createConfetti();
    }, 600);
  }
}

function createConfetti() {
  for (let i = 0; i < 40; i++) {
    const confetti = document.createElement('div');
    confetti.classList.add('confetti');
    confetti.style.left = `${Math.random() * 100}%`;
    confetti.style.backgroundColor = `hsl(${Math.random() * 360}, 100%, 50%)`;
    confetti.style.animationDuration = `${1 + Math.random() * 2}s`;
    document.body.appendChild(confetti);

    setTimeout(() => confetti.remove(), 3000);
  }
}

resetBtn.addEventListener('click', generateCards);
generateCards();
